Sage.Entity.Interfaces.ICustevent custe = BindingSource.Current as Sage.Entity.Interfaces.ICustevent;
NHibernate.ISession session = new Sage.Platform.Orm.SessionScopeWrapper();
string sql = string.Empty;


Sage.Platform.ChangeManagement.IChangedState state = custe as Sage.Platform.ChangeManagement.IChangedState;
if (state != null)
{
	Sage.Platform.ChangeManagement.PropertyChange changeRhMovein 	= state.GetChangedState().FindPropertyChange("RhmoveinDate");
    Sage.Platform.ChangeManagement.PropertyChange changeRhMoveout 	= state.GetChangedState().FindPropertyChange("RhmoveoutDate");
    Sage.Platform.ChangeManagement.PropertyChange changePMoveIn 	= state.GetChangedState().FindPropertyChange("Planningmovein");
    Sage.Platform.ChangeManagement.PropertyChange changePMoveOut 	= state.GetChangedState().FindPropertyChange("Planningmoveout");
	Sage.Platform.ChangeManagement.PropertyChange changeVAttendees 	= state.GetChangedState().FindPropertyChange("Verifiedattendees");
	Sage.Platform.ChangeManagement.PropertyChange changeVExhibiting	= state.GetChangedState().FindPropertyChange("Verifiedexhibitingco");

    if (changeRhMovein != null){
		session.CreateQuery("update OpportunityCIUDF set RHMoveInDate='"+dtpRhMoveIn.DateTimeValue+"' where Opportunityid='"+custe.Id.ToString()+"'")
		.ExecuteUpdate();    }

    if (changeRhMoveout != null){
		session.CreateQuery("update OpportunityCIUDF set RHMoveOutDate='"+dtpRhMoveOut.DateTimeValue+"' where Opportunityid='"+custe.Id.ToString()+"'")
		.ExecuteUpdate();    }

    if (changePMoveIn != null) {
		session.CreateQuery("update OpportunityCIUDF set PlanningMoveIn='"+dtpPlanningMoveIn.DateTimeValue+"' where Opportunityid='"+custe.Id.ToString()+"'")
		.ExecuteUpdate();    }

    if (changePMoveOut != null) {
		session.CreateQuery("update OpportunityCIUDF set PlanningMoveOut='"+dtpPlanningMoveOut.DateTimeValue+"' where Opportunityid='"+custe.Id.ToString()+"'")
		.ExecuteUpdate();    }

	if (changeVAttendees != null) {
		session.CreateQuery("update OpportunityCIUDF set VerifiedAttendees='"+txtVerifiedAttendees.Text+"' where Opportunityid='"+custe.Id.ToString()+"'")
		.ExecuteUpdate();    }

	if (changeVAttendees != null) {
		session.CreateQuery("update OpportunityCIUDF set VerifiedExhibitingCo='"+txtVerifiedExhibiting.Text+"' where Opportunityid='"+custe.Id.ToString()+"'")
		.ExecuteUpdate();    }

}
Response.Redirect("Custevent.aspx?entityId=" + custe.Id.ToString());
